import 'bootstrap/dist/js/'

const App = () => {

  const categories = [
    {
      id: 1,
      title: 'Hats',
      imageUrl:"https://i.ibb.co/cvpntL1/hats.png",
    },
    {
      id: 2,
      title: 'Jackets',
      imageUrl:"https://i.ibb.co/px2tCc3/jackets.png",
    },
    {
      id: 3,
