      imageUrl:"https://i.ibb.co/0jqHpnp/sneakers.png",
    },
    {
      id: 4,
      title: 'Womens',
      imageUrl:"https://i.ibb.co/GCCdy8t/womens.png",
    },
    {
      id: 5,
      title: 'Mens',
      imageUrl:"https://i.ibb.co/R70vBrQ/men.png",
    },   
  ];

  return (
    <h1>nana style</h1>,
    <Directory  className="bg-danger p-5" categories={categories}></Directory>
  );

}
export default App;
